let icon = "data:image/png;base64,";

Blockly.Blocks['set_chatbot'] = {
    init: function () {
      this.appendDummyInput()
        .appendField(new Blockly.FieldImage(icon, 40, 40, { alt: "*", flipRtl: "FALSE" }))
        .appendField("set chatbot to")
        .appendField(new Blockly.FieldDropdown([["ChatGPT", "CHATGPT"], ["IffyChat", "IFFYCHAT"]]), "NAME");
      this.setPreviousStatement(true, null);
      this.setNextStatement(true, null);
      this.setColour(160);
      this.setTooltip("Sets the chatbot to a specific one.");
      this.setHelpUrl("https://scratch.mit.edu/users/LoganCreatz#comments");
    }
  };
  Blockly.Blocks['chatbot_respond'] = {
    init: function () {
      this.appendDummyInput()
        .appendField(new Blockly.FieldImage(icon, 40, 40, { alt: "*", flipRtl: "FALSE" }))
        .appendField("chatbot response to")
        .appendField(new Blockly.FieldTextInput("How are you?"), "QUESTION");
      this.setOutput(true, null);
      this.setColour(160);
      this.setTooltip("Ask questions to the bot and more.");
      this.setHelpUrl("https://scratch.mit.edu/users/LoganCreatz#comments");
    }
  };
  Blockly.Blocks['chatbot_tell'] = {
    init: function () {
      this.appendDummyInput()
        .appendField(new Blockly.FieldImage(icon, 40, 40, { alt: "*", flipRtl: "FALSE" }))
        .appendField("tell chatbot")
        .appendField(new Blockly.FieldTextInput("You are really nerdy"), "NAME");
      this.setPreviousStatement(true, null);
      this.setNextStatement(true, null);
      this.setColour(160);
      this.setTooltip("Tells the bot some instructions to follow");
      this.setHelpUrl("https://scratch.mit.edu/users/LoganCreatz#comments");
    }
  };
  Blockly.Blocks['chatbot_reset'] = {
    init: function () {
      this.appendDummyInput()
        .appendField(new Blockly.FieldImage(icon, 40, 40, { alt: "*", flipRtl: "FALSE" }))
        .appendField("clear chatbot history");
      this.setPreviousStatement(true, null);
      this.setNextStatement(true, null);
      this.setColour(160);
      this.setTooltip("Clears the search and instruction history of the chatbot");
      this.setHelpUrl("https://scratch.mit.edu/users/LoganCreatz#comments");
    }
  };

// no javascript gens for these blocks

let aicategory = Bark.CreateCategory("A.I.", "#5E7D6C");
aicategory.addBlock(Bark.CreateBlock("set_chatbot"));
aicategory.addBlock(Bark.CreateBlock("chatbot_respond"));
aicategory.addBlock(Bark.CreateBlock("chatbot_tell"));
aicategory.addBlock(Bark.CreateBlock("chatbot_reset"));


Bark.AppendCategoryToToolbox(aicategory);
